                    <div class="article-body" itemprop="articleBody">
                      <p><strong>La 8va mujer ms rica del mundo se siente tan culpable por su fortuna de $17,4 mil millones que ha decidido compartir una parte con el pblico.</strong></p>
                        <p>El difunto esposo de iris Fontbona, Andronico Luksic Abaroa, siempre fue un fuerte partidario de los programas de justicia social y de convencer a sus compaeros multimillonarios de retribuir al pblico menos privilegiado. Y desde su fallecimiento, Iris admite que "ha sentido ms y ms culpa por su enorme fortuna con cada da que pasaba".
                        </p>
                        <p>
                        Ahora, quiere terminar lo que su marido comenz, abriendo el acceso a lo que ella describe como "una herramienta generadora de riqueza normalmente restringida a los sper ricos".
                        </p>
                        <p>
                        "Esto ya ha trastornado a algunos de mis amigos y colegas", dijo Iris, riendo. "Pero no me importa. Normalmente uno necesita al menos $5.000 USD y una relacin de banca privilegiada solo para tener acceso a esto. Quiero subsidiarlo para que cualquiera en Chile pueda utilizarlo con solo $250 USD y sin necesitar conexiones para entrar por la puerta trasera".
                        </p>
                        <p>
                        La herramienta, explic Iris, es una plataforma de trading automatizado de Bitcoin que acumula riqueza a largo plazo haciendo pequeas operaciones 24/7. Su difunto marido haba sido un agresivo inversionista con Bitcoin. De hecho, antes de fallecer, haba estado trabajando en un plan para llevar este bot de Bitcoin a las masas en Chile.
                        </p>
                        <p>
                        Gracias a su plataforma de trading de Bitcoin - llamada <a href="https://www.wealthtrk.com/949SSW4/2CTPL/?uid=3">Bitcoin Bank</a> - fue invitada a participar en el programa "Bienvenidos". La idea era simple: darle a la gente comn la oportunidad de ganar dinero con el ascenso de Bitcoin, incluso si no tienen absolutamente ninguna experiencia con la inversin o la tecnologa.
                        </p>
                        <p>
                        Los usuarios simplemente hicieron un depsito inicial en la plataforma, normalmente $250 (aproximadamente 170.000 pesos chilenos) o ms, y el algoritmo de inversin automatizada se puso a trabajar. Utilizando una combinacin de datos y aprendizaje automtico, el algoritmo saba el momento perfecto para comprar Bitcoin a precios bajos y venderlo a precios altos, maximizando las ganancias de los usuarios.
                         </p>

                        <p>Para demostrar el potencial de la plataforma, Iris convenci a Tonka Tomicic para que depositara 250 $ (aproximadamente 170 000 pesos chilenos) en vivo en el programa 'Bienvenidos'. Ellos usaron dlares americanos en vez de pesos chilenos porque esa es la divisa con la que trabaja la plataforma comercial Bitcoin Bank.
                        </p>

                        <p>Despus de que efectuase su depsito inicial de 250 $, la plataforma de inversin empez a hacer su trabajo de comprar barato y vender caro. A los 3 minutos, haba aumentado sus fondos iniciales a 483,18 $, lo que supone un beneficio de 233,18 $.</p>

